import React, { useState } from 'react';
import Timer from './Timer';
import Youtube from './Youtube/Youtube.js';
import Quote from './Quotes.js';
import './App.css';
import Cloud from './cloud.png';

function App() {
  return (
    <div className="App">

      <Timer/>
      <Youtube/>
      <Quote/>
      {/* <text className="playlist">this is a playlist</text> */}
      {Cloud}
    </div>
  )
}

export default App;
